import Axios from 'axios';
import React, { Component } from 'react'
import DebutantModal from './DebutantModal'

export class NiveauDebutant extends Component {
    state={
        debutant: []
    }

    componentDidMount() {
        this.getNiveau();
    }

    getNiveau = () => {
        Axios.get('debutants')
            .then(response => {
                console.log(response)
                this.setState({
                    debutant: response.data
                })
            })
    }
    render() {
        const niveau = this.state.debutant
        return (
            <div>
                {niveau && niveau.map(niveau => {
                    <div className="x_panel">
                        <div className="x_title">
                        <h2>Test Chauffeur <small>{niveau.titre} </small></h2>
                        <div className="clearfix"></div>
                        </div>
                        <div className="x_content">

                        <table className="table">
                            <thead>
                            <tr>
                                <th>Numero</th>
                                <th>Test</th>
                                <th>Reponse</th>
                                <th>Action</th>
                            </tr>
                            </thead>
                            <tbody>
                            <tr>
                                <th scope="row">1</th>
                                <td>Vitesse maximum taxi-brousse?</td>
                                <td>75 Km/h</td>
                                <td>  

                                    <ul className="nav navbar-right panel_toolbox">
                                        <li> <a className="btn btn-danger" role="button">
                                            <i className="fa fa-trash"></i>
                                            </a>
                                        </li>

                                        <li> <a className="btn btn-primary" role="button">
                                                <i className="fa fa-paper-plane-o"></i>
                                                </a>
                                        </li>
                                    </ul>
                                </td>
                            </tr>
                            </tbody>
                        </table>
                        <center><DebutantModal/></center>
                        </div>
                    </div>
                })}
            </div>
        )
    }
}

export default NiveauDebutant
